create table users (
  id serial primary key,
  username varchar(50),
  password varchar(50)
);

create table property (
  id serial primary key,
  userid integer references users(id),
  property_name varchar(50),
  description text,
  loan float,
  mortgage float,
  recommended_rent float,
  desired_rent float,
  address varchar(50),
  city varchar(50),
  state varchar(50),
  zip varchar(15)
)


